# OsString in std::ffi::os\_str - Rust

```
pub struct OsString { /* private fields */ }
```

Expand description

A type that can represent owned, mutable platform-native strings, but is cheaply inter-convertible with Rust strings.

The need for this type arises from the fact that:

-   On Unix systems, strings are often arbitrary sequences of non-zero bytes, in many cases interpreted as UTF-8.

-   On Windows, strings are often arbitrary sequences of non-zero 16-bit values, interpreted as UTF-16 when it is valid to do so.

-   In Rust, strings are always valid UTF-8, which may contain zeros.


`OsString` and [`OsStr`](../struct.OsStr.html "struct std::ffi::OsStr") bridge this gap by simultaneously representing Rust and platform-native string values, and in particular allowing a Rust string to be converted into an â€œOSâ€ string with no cost if possible. A consequence of this is that `OsString` instances are _not_ `NUL` terminated; in order to pass to e.g., Unix system call, you should create a [`CStr`](../struct.CStr.html "struct std::ffi::CStr").

`OsString` is to `&[OsStr](../struct.OsStr.html "struct std::ffi::OsStr")` as [`String`](../../string/struct.String.html "struct std::string::String") is to `&[str](../../primitive.str.html "primitive str")`: the former in each pair are owned strings; the latter are borrowed references.

Note, `OsString` and [`OsStr`](../struct.OsStr.html "struct std::ffi::OsStr") internally do not necessarily hold strings in the form native to the platform; While on Unix, strings are stored as a sequence of 8-bit values, on Windows, where strings are 16-bit value based as just discussed, strings are also actually stored as a sequence of 8-bit values, encoded in a less-strict variant of UTF-8. This is useful to understand when handling capacity and length values.

## [Â§](#capacity-of-osstring)Capacity of `OsString`

Capacity uses units of UTF-8 bytes for OS strings which were created from valid unicode, and uses units of bytes in an unspecified encoding for other contents. On a given target, all `OsString` and `OsStr` values use the same units for capacity, so the following will work:

```
use std::ffi::{OsStr, OsString};

fn concat_os_strings(a: &OsStr, b: &OsStr) -> OsString {
    let mut ret = OsString::with_capacity(a.len() + b.len()); // This will allocate
    ret.push(a); // This will not allocate further
    ret.push(b); // This will not allocate further
    ret
}
```

