## [Â§](#creating-an-osstring)Creating an `OsString`

**From a Rust string**: `OsString` implements `[From](../../convert/trait.From.html "trait std::convert::From")<[String](../../string/struct.String.html "struct std::string::String")>`, so you can use `my_string.[into](about:blank/convert/trait.Into.html#tymethod.into "method std::convert::Into::into")()` to create an `OsString` from a normal Rust string.

**From slices:** Just like you can start with an empty Rust [`String`](../../string/struct.String.html "struct std::string::String") and then [`String::push_str`](about:blank/string/struct.String.html#method.push_str "method std::string::String::push_str") some `&[str](../../primitive.str.html "primitive str")` sub-string slices into it, you can create an empty `OsString` with the [`OsString::new`](about:blank/struct.OsString.html#method.new "associated function std::ffi::OsString::new") method and then push string slices into it with the [`OsString::push`](about:blank/struct.OsString.html#method.push "method std::ffi::OsString::push") method.

You can use the [`OsString::as_os_str`](about:blank/struct.OsString.html#method.as_os_str "method std::ffi::OsString::as_os_str") method to get an `&[OsStr](../struct.OsStr.html "struct std::ffi::OsStr")` from an `OsString`; this is effectively a borrowed reference to the whole string.

