1.74.0 Â· [source](about:blank/src/std/ffi/os_str.rs.html#186-188)

Converts bytes to an `OsString` without checking that the bytes contains valid [`OsStr`](../struct.OsStr.html "struct std::ffi::OsStr")\-encoded data.

The byte encoding is an unspecified, platform-specific, self-synchronizing superset of UTF-8. By being a self-synchronizing superset of UTF-8, this encoding is also a superset of 7-bit ASCII.

See the [moduleâ€™s toplevel documentation about conversions](about:blank/index.html#conversions "mod std::ffi") for safe, cross-platform [conversions](about:blank/index.html#conversions "mod std::ffi") from/to native representations.

##### [Â§](#safety)Safety

As the encoding is unspecified, callers must pass in bytes that originated as a mixture of validated UTF-8 and bytes from [`OsStr::as_encoded_bytes`](about:blank/struct.OsStr.html#method.as_encoded_bytes "method std::ffi::OsStr::as_encoded_bytes") from within the same Rust version built for the same target platform. For example, reconstructing an `OsString` from bytes sent over the network or stored in a file will likely violate these safety rules.

Due to the encoding being self-synchronizing, the bytes from [`OsStr::as_encoded_bytes`](about:blank/struct.OsStr.html#method.as_encoded_bytes "method std::ffi::OsStr::as_encoded_bytes") can be split either immediately before or immediately after any valid non-empty UTF-8 substring.

##### [Â§](#example)Example

```
use std::ffi::OsStr;

let os_str = OsStr::new("Mary had a little lamb");
let bytes = os_str.as_encoded_bytes();
let words = bytes.split(|b| *b == b' ');
let words: Vec<&OsStr> = words.map(|word| {
    // SAFETY:
    // - Each `word` only contains content that originated from `OsStr::as_encoded_bytes`
    // - Only split with ASCII whitespace which is a non-empty UTF-8 substring
    unsafe { OsStr::from_encoded_bytes_unchecked(word) }
}).collect();
```

