Converts the `OsString` into a byte slice. To convert the byte slice back into an `OsString`, use the [`OsStr::from_encoded_bytes_unchecked`](about:blank/struct.OsStr.html#method.from_encoded_bytes_unchecked "associated function std::ffi::OsStr::from_encoded_bytes_unchecked") function.

The byte encoding is an unspecified, platform-specific, self-synchronizing superset of UTF-8. By being a self-synchronizing superset of UTF-8, this encoding is also a superset of 7-bit ASCII.

Note: As the encoding is unspecified, any sub-slice of bytes that is not valid UTF-8 should be treated as opaque and only comparable within the same Rust version built for the same target platform. For example, sending the bytes over the network or storing it in a file will likely result in incompatible data. See [`OsString`](../struct.OsString.html "struct std::ffi::OsString") for more encoding details and [`std::ffi`](../index.html "mod std::ffi") for platform-specific, specified conversions.

