ğŸ”¬This is a nightly-only experimental API. (`os_str_slice`Â [#118485](https://github.com/rust-lang/rust/issues/118485))

Takes a substring based on a range that corresponds to the return value of [`OsStr::as_encoded_bytes`](about:blank/struct.OsStr.html#method.as_encoded_bytes "method std::ffi::OsStr::as_encoded_bytes").

The rangeâ€™s start and end must lie on valid `OsStr` boundaries. A valid `OsStr` boundary is one of:

-   The start of the string
-   The end of the string
-   Immediately before a valid non-empty UTF-8 substring
-   Immediately after a valid non-empty UTF-8 substring

##### [Â§](#panics)Panics

Panics if `range` does not lie on valid `OsStr` boundaries or if it exceeds the end of the string.

##### [Â§](#example-1)Example

```
#![feature(os_str_slice)]

use std::ffi::OsStr;

let os_str = OsStr::new("foo=bar");
let bytes = os_str.as_encoded_bytes();
if let Some(index) = bytes.iter().position(|b| *b == b'=') {
    let key = os_str.slice_encoded_bytes(..index);
    let value = os_str.slice_encoded_bytes(index + 1..);
    assert_eq!(key, "foo");
    assert_eq!(value, "bar");
}
```

